import styles from './Card.module.scss';


function Card(props) {
    return(
        <div className = {styles.card}>
            <div className = {styles.favourite}>
                <img src="/img/NonActive.svg" alt="Unlicked"/>
            </div>
            
            <img width = {133} height = {112} src ={props.imageUrl} alt ="Sneakers" onClick = {props.onFavorite}/>
            <h5>{props.title}</h5>
            <div className = "d-flex justify-between align-center">
                <div className = "d-flex flex-column">
                    <span>Цена:</span>
                    <b>{props.price}</b>
                </div>
        
                <img className = {styles.plus} onClick = {props.onPlus} width = {11} height = {11} src="/img/Plus.svg" alt="Plus"/>
    
            </div>
        </div>
    )
}
export default Card;
